import config from './config';

const http = async ({
    url, method
}) => {
    console.log(url, method, '=====');
    const res = await fetch(config.serverUrl + '/api/agent', {
        headers: {
          'content-type': 'application/json',
          'api-url': url,
          'api-method': method
        },
        method: 'POST',
    });
    return await res.json();
}

export default http
